function mirrorDrawing(inputArray, lines, componentsPerLine)
    local mirroredArray = {}
    
    for line = 1, lines do
        local startIdx = (line - 1) * componentsPerLine + 1
        local endIdx = line * componentsPerLine

        local mirroredLine = {}

        for i = endIdx, startIdx, -1 do
            table.insert(mirroredLine, inputArray[i])
        end

        for _, element in ipairs(mirroredLine) do
            table.insert(mirroredArray, element)
        end
    end

    return mirroredArray
end

local totalComponents = 43200
local lines = 180
local componentsPerLine = totalComponents / lines


function rotateNegative90(inputArray, lines, componentsPerLine)
    local rotatedArray = {}

    for componentIdx = 1, componentsPerLine do
        for line = 1, lines do
            local originalIdx = (line - 1) * componentsPerLine + componentIdx
            table.insert(rotatedArray, inputArray[originalIdx])
        end
    end

    return rotatedArray
end

